import React, { useState } from 'react';
import axios from 'axios';
import "./show_blog.css";
import { useNavigate, useParams } from 'react-router-dom';

export default function ShowBlog(){

    const navigate=useNavigate();

    const {title,content,likesCount,tiimeStamp}=useParams();
    const logo="BlogSpace";
    return (
        <div className="main-body">
            <div className='logoo'>
                {logo}
            </div>
            <div className='main-body-blogForm'>
                <textarea id="title" type="text" placeholder="Title" disabled="true"/>{title}<br></br>
                <textarea id="content" placeholder="Content"/>{content}
            </div>
            <div>
                <div>Likes Count: {likesCount}</div>
                <div>TimeStamp:{tiimeStamp}</div>
            </div>
        </div>
    );
};
